import React from "react";

function ProductName(props) {
  return (
    <div className="text-start text-6xl leading-tight ">
      <h1>{props.title}</h1>
    </div>
  );
}
function SubHeadingProduct(props) {
  return (
    <div className=" ">
      <h3>{props.text}</h3>
    </div>
  );
}
function ConsistOf(props) {
  return (
    <div className="text-start">
      <h3>Consist Of :</h3>
      <div className="text-center px-">
        <p>{props.discription}</p>
      </div>
    </div>
  );
}
function FeaturesProduct(props) {
  return (
    <div className="">
      <h3>Features :</h3>
      <div className="">
        <p>{props.discription}</p>
      </div>
    </div>
  );
}

const Slider = () => {
  return (
    <div className="flex flex-col">
      {/* text section */}
      <div className="container xl:w-1/2 sm:w-1/2 h-full justify-center items-center text-center p-16 bg-primaryTwo font-inder overflow-auto"  >
        {/* h1- Product Name */}
        <ProductName  title={"Sustainability Starter Kit"} />
        {/* h3- Sub Heading */}
        <SubHeadingProduct text={'This starter kit is all you need to start the revolution.'} />
        {/* h3 - consist*/}
        <ConsistOf discription={'2 Bamboo Straws 1 Plant Based Reusable Cup with 2 lids 1 Natural Loofah 1 box of 50 Bamboo Cotton Eartips 1 Bamboo Toothbrush' } />
        {/* p - consist disciption*/}
        {/* h3- Features*/}
        <FeaturesProduct discription={'Govt Approved, Tested, and approved in TUV Rhineland, Germany100% recyclable and non-toxicLeak-ProofOdorless tasteless and doesn’t react with hot beveragesLightweightMicrowavable'} />
        {/* p - disciption*/}
        {/* button*/}
        <div className="">
          <button className="bg-white border-1 shadow-xl border-[#000000] hover:bg-[#D9D9D9] hover:text-primaryFour  text-black font-bold py-2 px-4" w-10>Buy Now</button>
        </div>
      </div>
      {/* Img section */}

    </div>
  );
};

export default Slider;
